import React from 'react';
import { Image,TouchableOpacity,StyleSheet, Text, View, TextInput, Alert } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
        <View style={styles.header}>
            <TouchableOpacity style={styles.ProfileIcon}>
            <Image source={require('C:/Users/Liran/CryptoChat/img/icon.png')}/>
            </TouchableOpacity>
        </View>
        </View>
    
  );
}

const styles = StyleSheet.create({
    png:{
    
    },
    ProfileIcon:{
      height:200,
      width:200,
      
    },
    Settings:{

    },
    header:{
      flex: 1,
      position: 'absolute',
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: 'transparent'
    
    },
